    "\u0046\u0061\u0069\u006c\u0065\u0064\u0020\u0074\u006f\u0020\u0074\u0075\u0072\u006e\u0020\u006f\u0066\u0066": "\u0041\u0075\u0073\u0073\u0063\u0068\u0061\u006c\u0074\u0065\u006e\u0020\u0066\u0065\u0068\u006c\u0067\u0065\u0073\u0063\u0068\u006c\u0061\u0067\u0065\u006e",
    "\u0054\u0075\u0072\u006e\u0065\u0064\u0020\u006f\u0066\u0066": "\u0041\u0075\u0073\u0067\u0065\u0073\u0063\u0068\u0061\u006c\u0074\u0065\u0074",
    "\u0049\u006e\u0020\u0070\u0072\u0069\u0076\u0061\u0063\u0079\u0020\u006d\u006f\u0064\u0065": "\u0069\u006d\u0020\u0044\u0061\u0074\u0065\u006e\u0073\u0063\u0068\u0075\u0074\u007a\u006d\u006f\u0064\u0075\u0073",
